sys_script_include.script:
var VsphereLoginParams = Class.create();

VsphereLoginParams.prototype = {
  initialize: function () {
    this.Endpoint = probe.getParameter('url');
    this.Identity = probe.getParameter('username');
    this.Credentials = probe.getParameter('password');
  },

  type: 'VsphereLoginParams'
};

VsphereLoginParams.prototype.get = function (name) {
  return this[name];
};
